import React, { useState, useEffect } from 'react';
import axios from 'axios';
import "./styles.css";



function writePersonUserData() {
  const instance = axios.create({baseURL: 'http://localhost:5000/personuppgifter'})
  const [data, setData] = useState([]);

  useEffect(() => {
    instance.post('/user', {
        firstName: 'Fred',
        lastName: 'Flintstone'
      })
  }, []);
}

export default writePersonUserData;
